import React, {Component} from 'react';
import './App.css';
import Header from './components/header';
import {
    Button
} from 'reactstrap';

class App extends Component {
    render() {
        return (
            <React.Fragment>
                <Header/>

                <main role="main">
                    <section className="jumbotron">
                        <div className="row">



                        </div>
                    </section>
                </main>
            </React.Fragment>
        );
    }
}

export default App;
